	(553, 'ru', '', 'The database was not found on the server. If you have permissions to create it now, click on the following link.', 'База, которую вы выбрали не существует на сервере. Если у вас есть права <br/>на ее создание, ее можно создать сейчас.', 'f7424156f5bdc11ad9022815c90a0fb193dcb74a'),
